import React from "react";
import {NavLink} from "react-router-dom";

// import {Link} from 'react-scroll'

const Menu = () => {

  return (

    <div className="o-col t-site-header__menu">
      <ul className="c-nav">
          <li className="c-btn c-btn--start c-nav__item c-heading--level4 e-alignCenter"><NavLink exact to="/">Start</NavLink></li>
          <Link to="four-steps" className={"button"} smooth={true} duration={1000}>O co chodzi?</Link>
          <li className="c-btn c-nav__item c-heading--level4 e-alignCenter"><Link to="four-steps"smooth={true} duration={1000}></Link>O co chodzi</li>
          <li className="c-btn c-nav__item c-heading--level4 e-alignCenter">O nas</li>
          <li className="c-btn c-nav__item c-heading--level4 e-alignCenter">Fundacje i  organizacje</li>
          <li className="c-btn c-nav__item c-heading--level4 e-alignCenter">Kontakt</li>
      </ul>
    </div>

  )
}

export default Menu;
